import React, { Component } from 'react';

class AdminIntro extends Component {
    render() {
        return (
            <div>
                <p>
                            <b>Intro Page</b> 
                        </p>

                        <textarea
                            type="text"
                            placeholder="Text"
                            defaultValue={null} 
                            onChange={(event) => this.handleInput(event)}
                            rows={6}
                        />

                        <p>Choose Image</p>
            </div>
        );
    }
}

export default AdminIntro;
